import Header from "./component/header";
import HeaderHero from "./Hero/Header.hero";
import Feature from "./component/Feature/Feature";
import "./App.css";

const App = () => {
  return (
    <div>
      <Header />
      <HeaderHero />
      <Feature />
      <div className="div_hello"></div>
    </div>
  );
};

export default App;
